/**
 * Get icon by path
 */
export function getIconByPath(path: string): IconInfo | undefined {
  return iconRegistry.find((icon) => icon.path === path);
}

/**
 * Get icons by category
 */
// Faces grouping helpers
function getEmojiIdFromPath(p: string): string {
  const file = p.split("/").pop() || "";
  return file.replace(".png", "");
}
function getBaseCode(id: string): string {
  const first = id.split("-")[0];
  return first.toUpperCase().replace("FE0F", "");
}
const FACE_EXTRA_SET = new Set<string>([
  "263A",
  "2639",
  "1F970",
  "1F971",
  "1F972",
  "1F97A",
  "1F9D0",
  "1F60E",
  "1F636",
  "1F637",
  "1F912",
  "1F915",
  "1F922",
  "1F92E",
  "1F927",
  "1F975",
  "1F976",
  "1F974",
  "1F635",
  "1F92F",
  "1FAE0",
  "1FAE1",
  "1FAE2",
  "1FAE3",
  "1FAE4",
  "1FAE5",
  "1FAE8",
  "1FAE9",
  "1F910",
  "1F911",
  "1F913",
  "1F920",
  "1F928",
  "1F978",
  "1F979",
]);
function isFaceEmoji(idOrIcon: string | IconInfo): boolean {
  const id =
    typeof idOrIcon === "string" ? idOrIcon : getEmojiIdFromPath(idOrIcon.path);
  const base = getBaseCode(id);
  const hex = parseInt(base, 16);
  const inEmoticonsBlock =
    !Number.isNaN(hex) && hex >= 0x1f600 && hex <= 0x1f64f;
  return inEmoticonsBlock || FACE_EXTRA_SET.has(base);
}

export function getIconsByCategory(category: string): IconInfo[] {
  const items = iconRegistry.filter((icon) => icon.category === category);
  if (category === "smileys-emotion") {
    return items.slice().sort((a, b) => {
      const fa = isFaceEmoji(a) ? 0 : 1;
      const fb = isFaceEmoji(b) ? 0 : 1;
      if (fa !== fb) return fa - fb;
      const ida = getBaseCode(getEmojiIdFromPath(a.path));
      const idb = getBaseCode(getEmojiIdFromPath(b.path));
      const na = parseInt(ida, 16);
      const nb = parseInt(idb, 16);
      if (!Number.isNaN(na) && !Number.isNaN(nb) && na !== nb) return na - nb;
      return a.name.localeCompare(b.name);
    });
  }
  return items;
}

/**
 * Get all available categories
 */
export function getCategories(): string[] {
  const raw = Array.from(new Set(iconRegistry.map((icon) => icon.category)));
  const priority = ["smileys-emotion", "food-drink", "animals-nature"];
  const withoutCustom = raw.filter(
    (c) => c !== "custom" && c !== "religion-culture"
  );
  const ordered = [
    ...priority.filter((c) => withoutCustom.includes(c)),
    ...withoutCustom.filter((c) => !priority.includes(c)).sort(),
  ];
  return ordered;
}

/**
 * Get category display name
 */
export function getCategoryDisplayName(category: string): string {
  const displayNames: Record<string, string> = {
    "smileys-emotion": "Smileys & Emotion",
    "people-body": "People & Body",
    "animals-nature": "Animals & Nature",
    "food-drink": "Food & Drink",
    "activities-events": "Activities & Events",
    "travel-places": "Travel & Places",
    "objects-tools": "Objects & Tools",
    symbols: "Symbols",
    flags: "Flags",
    "religion-culture": "Religion & Culture",
    custom: "Custom",
  };
  return (
    displayNames[category] ||
    category.charAt(0).toUpperCase() + category.slice(1)
  );
}

/**
 * Get skin tone variants for an emoji
 */
export function getSkinToneVariants(baseEmojiPath: string): string[] {
  const baseEmoji = baseEmojiPath.split("/").pop()?.replace(".png", "") || "";
  const emoji = iconRegistry.find((icon) => icon.baseEmoji === baseEmoji);
  return emoji?.skinToneVariants || [];
}

/**
 * Check if emoji has skin tone variants
 */
export function hasSkinToneVariants(emojiPath: string): boolean {
  const baseEmoji = emojiPath.split("/").pop()?.replace(".png", "") || "";
  const emoji = iconRegistry.find((icon) => icon.baseEmoji === baseEmoji);
  return emoji?.hasSkinTones || false;
}

/**
 * Get custom stamps as icons
 */
export function getCustomStampsAsIcons(): IconInfo[] {
  const customStamps = getCustomStamps();
  return customStamps.map((stamp: CustomStamp) => ({
    name: stamp.name,
    category: "custom",
    path: stamp.dataUrl,
    preview: stamp.preview,
    keywords: stamp.name
      .toLowerCase()
      .split(/[^a-z0-9]+/)
      .filter(Boolean),
  }));
}

/**
 * Get all categories including custom
 */
export function getAllCategories(): string[] {
  const standardCategories = getCategories();
  const customStamps = getCustomStamps();

  if (customStamps.length > 0) {
    return [...standardCategories, "custom"];
  }

  return standardCategories;
}

/**
 * Get icons by category including custom stamps
 */
export function getIconsByCategoryWithCustom(category: string): IconInfo[] {
  if (category === "custom") {
    return getCustomStampsAsIcons();
  }
  return getIconsByCategory(category);
}

/**
 * Get all icons including custom stamps
 */
export function getAllIcons(): IconInfo[] {
  const all = [...iconRegistry, ...getCustomStampsAsIcons()];
  const priority = ["smileys-emotion", "food-drink", "animals-nature"];
  const getPrio = (c: string) => {
    const i = priority.indexOf(c);
    return i === -1 ? priority.length : i;
  };
  return all.slice().sort((a, b) => {
    const pa = getPrio(a.category);
    const pb = getPrio(b.category);
    if (pa !== pb) return pa - pb;
    if (a.category !== b.category) return a.category.localeCompare(b.category);

    if (a.category === "smileys-emotion" && b.category === "smileys-emotion") {
      const fa = isFaceEmoji(a) ? 0 : 1;
      const fb = isFaceEmoji(b) ? 0 : 1;
      if (fa !== fb) return fa - fb;
    }
    return a.name.localeCompare(b.name);
  });
}

